It’s amazing that the best #personaldevelopment advice always begins with #beyourself (and when done well, then evolves into dream bigger, challenge yourself, develop more skills and emotional mastery, and serve others with excellence).

The trick is to make #selfimprovement a way of life by daily reflection, habit review and goal planning. ( you can do all that with GrowthDay app.).

@growthday #motivation
